import React from 'react';
import styled from 'styled-components';

const SideBar: React.FC = () => {
    return (
        <GridContainer>
            <Side>
                SIDEBAR
            </Side>
        </GridContainer>
    )
}

export default SideBar;

const GridContainer = styled.div`
    position: fixed;
    top: 10px;
    left: 10px;
    display: grid;
    grid-template-areas:
    '. . . . . . . . s s'
    '. . . . . . . . s s'
    '. . . . . . . . s s'
    '. . . . . . . . s s'
    '. . . . . . . . s s'
    '. . . . . . . . s s'
    '. . . . . . . . s s';
    grid-gap: 10px;
    width: 99%;
    height: 98%;
`;

const Side = styled.div`
    grid-area: s;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    border-radius: 30px;
    background-color: ${({ theme }) => theme.colors.black20};
`;

const MainDisplay = styled.div`
    grid-area: .;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    border-radius: 30px;
    background-color: ${({ theme }) => theme.colors.black20};
`;

